import React, { Component } from 'react';
import { Row, Col, Card, CardHeader, CardBody, FormGroup, Label, FormText, InputGroup, InputGroupAddon, InputGroupText } from 'reactstrap';
// React select
import states from '../Forms/AdvancedForms/data/states';
import Select from 'react-select';
import 'react-select/dist/react-select.min.css';

const options = states.US;

class AddHealthArea extends Component {
  constructor(props) {
    super(props);
    this.saveChanges = this.saveChanges.bind(this);
    this.state = {
      value1: [],
      value2: []
    };
  }

  saveChanges(value) {
    this.setState({ value });
  }

  render() {

    return (
      <div className="animated fadeIn">
        <Row>
          <Col sm={12} md={6} style={{ flexBasis: 'auto' }}>
            <Card>
              <CardHeader>
                <i className="icon-note"></i><strong>Add Health Area</strong>{' '}
              </CardHeader>
              <CardBody>
                <FormGroup>
                  <Label>Realm</Label>
                  <Select
                    name="form-field-name1"
                    value={this.state.value}
                    options={options}
                    onChange={this.saveChanges}

                  />
                  <Label>Country</Label>
                  <Select
                    name="form-field-name2"
                    value={this.state.value}
                    options={options}
                    onChange={this.saveChanges}
                    multi
                  />
                </FormGroup>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}

export default AddHealthArea;
